(1, 'catalogue', '', 0, 'Catalogue Général Festi', '', '', '', '', '', '1', '1', '1', 'Inconnu', '', 'cat', 'reel', '', '0', 0.00, 0, 0, '0', '2006-01-01', '2099-12-31', '0', '1', '0', '', '2011-10-20 16:24:45'),
(2, 'Tables ', '', 0, 'Tables ', 'Tafels', 'Tables', 'Location de tables à Bruxelles et dans toute la Belgique.\r\nDe la location de tables rondes à la location de tables de brasserie en passant par la location de tables américaines et la location de tables de bridge.', 'Verhuur van tafels in Brussel en heel België.\r\nVerhuur van ronde tafels tot verhuur van brouwerij tafels, verhuur van Amerikaanse tafels tot verhuur van hoge tafels.', 'Tables for rent in Brussels and all over Belgium.\r\nFrom Standing table for rent to round table for rent through buffet table for rent and from brewery table for rent to bridge table. ', '1', '1', '1', 'Inconnu', '', 'cat', 'reel', '', '0', 0.00, NULL, NULL, '0', '2006-01-01', '2099-12-31', '0', '1', '0', '', '2012-03-08 09:03:55'),
(3, 'Chaises', '', 0, 'Chaises', 'Stoelen', 'Chairs', 'Location de chaises à Bruxelles et dans toute la Belgique.\r\nDe la location de la chaise pliante à la location de la chaise houssée en passant par la location de chaises de conférence, la location de bancs et la location de poufs.', 'Verhuur van stoelen in Brussel en heel België.\r\nVerhuur van klapstoel tot verhuur van banken, verhuur van poufs tot verhuur van barkruken.', 'Chairs to rent in Brussels and all over Belgium.\r\nFrom folding chair to rent to chairs with cover to rent and from conference chair to rent to bench to rent.', '1', '1', '1', 'Inconnu', '', 'cat', 'reel', '', '0', 0.00, NULL, NULL, '0', '2006-01-01', '2099-12-31', '0', '1', '0', '', '2012-03-08 09:04:19'),
(4, 'Nappages', '', 0, 'Nappages', 'Tafelkleden', 'Tablecloth', 'Location de nappes à Bruxelles et dans toute la Belgique.\r\nLocation de nappes de différentes tailles et coloris. Location de serviettes de différentes tailles et coloris. Location de molletons de différentes tailles. Vente de serviettes en papier.', 'Verhuur van tafelkleden en servetten van verschillende maten en kleuren\r\nVerhuur van servetten in Brussel en heel België.\r\nVerhuur van gewatteerde tafelkleden. Verkoop van papieren servetten ', 'Renting of tablecloth in Brussels and all over Belgium.\r\nRenting of tablecloth in several sizes and colors. Rental and sale of napkins in different colors ', '1', '1', '1', 'Inconnu', '', 'cat', 'reel', '', '0', 0.00, NULL, NULL, '0', '2006-01-01', '2099-12-31', '0', '1', '0', '', '2012-03-08 09:07:26'),
(5, 'Porcelaine ', '', 0, 'Vaisselle', 'Vaatwerk', 'Dishes', 'Location de vaisselle à Bruxelles et dans toute la Belgique.\r\nDe la location de l''assiette à la location de verres en cristal en passant par la location de cuillères en argent et la location de plateaux de service.', 'Verhuur van vaatwerk in Brussel en heel België.\r\nVerhuur van borden tot verhuur van glazen, verhuur van zilveren lepels tot verhuur van dienbladen.\r\n', 'Renting of dishes in Brussels and all over Belgium.\r\nFrom plate for rent to glass for rent and from spoon for rent to tray for rent. ', '1', '1', '1', 'Inconnu', '', 'cat', 'reel', '', '0', 0.00, 0, 0, '0', '2006-01-01', '2099-12-31', '0', '1', '0', '', '2012-03-08 09:05:43'),
